rm_empty = [] if lst is None else lst
if plate.name == 'Plate':
    return clean_list(rm_empty, plate, header=header)
elif plate.name == 'Inserts':
    n = 0
    for parts in plate:
        parts = parts if header else parts[1:, 1:]
        u = len(parts)
        for part in parts:
            if header:
                if n == 0:
                    part[0] = 'TOP'
                elif u == n:
                    part[0] = 'BOT'
            if u == n:
                rm_empty.append([])
            clean_list(rm_empty, part, parts=True)
            n += 1
    return rm_empty
